import { Button, Card, CardContent, CircularProgress, Grid, TextField, Typography } from '@mui/material';
import { useState, useEffect } from 'react';
import { useNavigate, useParams } from 'react-router-dom';

export default function NewMedidor() {
  const [task, setTask] = useState({
    rut: '',
    codigo: '',
    nombre: '',
    fecha_creacion: '',
    descripcion: '',
  });

  const [loading, setLoading] = useState(false);
  const navigate = useNavigate();
  const params = useParams();

  const handleSubmit = async (e) => {
    e.preventDefault();
    setLoading(true);

    try {

              // Paso 1: Crear un nuevo medidor
      const datosCliente = await fetch(`http://localhost:4000/tasks/${id}`, {
        method: 'POST',
        headers: {
          "Content-Type": "application/json",
        },
        body: JSON.stringify(task),
      });

      // Paso 1: Crear un nuevo medidor
      const medidorResponse = await fetch('http://localhost:4000/medidores', {
        method: 'POST',
        headers: {
          "Content-Type": "application/json",
        },
        body: JSON.stringify(task),
      });

      // Paso 2: Crear una nueva entrada en la tabla cliente_medidor
      const medidor = await medidorResponse.json();

      // Asociar el medidor al cliente (Asegúrate de tener el ID del cliente)
      const clienteId = await fetch(`http://localhost:4000/tasks/rut/${params.id}`, {
        method: 'POST',
        headers: {
          "Content-Type": "application/json",
        },
        body: JSON.stringify(task),
      });// Reemplaza params.id por el ID del cliente

      await fetch('http://localhost:4000/associate', {
        method: 'POST', // Puedes usar el método POST o el que corresponda en tu API
        headers: {
          "Content-Type": "application/json",
        },
        body: JSON.stringify({
          id: medidor.id, // ID del medidor recién creado
          cliente_rut: clienteId, // ID del cliente al que se asocia el medidor
        }),
      });

      setLoading(false);
      navigate('/');
    } catch (error) {
      console.error('Error al crear y asociar medidor:', error);
      setLoading(false);
    }
  };

  const handleChange = (e) => {
    const { name, value } = e.target;
    setTask((prevTask) => ({
      ...prevTask,
      [name]: value,
    }));
  };

  return (
    <Grid container direction='column' alignItems='center' justifyContent='center'>
      <Grid item xs={3}>
        <Card sx={{ mt: 5 }} style={{ backgroundColor: '#1e272e', padding: '1rem' }}>
          <Typography variant='h5' textAlign='center' color='white'>
            Agregar Medidor
          </Typography>
          <CardContent>
            <form onSubmit={handleSubmit}>
              <TextField
                name='rut'
                value={task.rut}
                variant='filled'
                label='RUT o Código'
                sx={{ display: 'block', margin: '.5rem 0' }}
                onChange={handleChange}
                inputProps={{ style: { color: 'white' } }}
                InputLabelProps={{ style: { color: 'white' } }}
              />
              <TextField
                name='codigo'
                value={task.codigo}
                variant='filled'
                label='Código'
                sx={{ display: 'block', margin: '.5rem 0' }}
                onChange={handleChange}
                inputProps={{ style: { color: 'white' } }}
                InputLabelProps={{ style: { color: 'white' } }}
              />
              <TextField
                name='nombre'
                value={task.nombre}
                variant='filled'
                label='Nombre'
                sx={{ display: 'block', margin: '.5rem 0' }}
                onChange={handleChange}
                inputProps={{ style: { color: 'white' } }}
                InputLabelProps={{ style: { color: 'white' } }}
              />
              <TextField
                name='fecha_creacion'
                value={task.fecha_creacion}
                variant='filled'
                label='Fecha de Creación'
                type='date'
                sx={{ display: 'block', margin: '.5rem 0' }}
                onChange={handleChange}
                inputProps={{ style: { color: 'white' } }}
                InputLabelProps={{ style: { color: 'white' } }}
              />
              <TextField
                name='descripcion'
                value={task.descripcion}
                variant='filled'
                label='Descripcion'
                multiline
                rows={4} sx={{ display: 'block', margin: '.5rem 0' }}
                onChange={handleChange}
                inputProps={{ style: { color: 'white' } }}
                InputLabelProps={{ style: { color: 'white' } }}
              />
              <Button variant='contained' color='primary' type='submit' disabled={!task.codigo || !task.nombre || !task.fecha_creacion}>
                {loading ? <CircularProgress color='inherit' size={24} /> : 'Guardar'}
              </Button>
            </form>
          </CardContent>
        </Card>
      </Grid>
    </Grid>
  );
}
